import styled from "styled-components";

export const Container = styled.div`
  width: 1440px;
  height: 1024px;
  border: 1px solid #c2c2c2;
  border-radius: 12px;
  margin: auto;
  display: flex;
  flex-direction: column;
  align-items: center;

  &:before {
    content: "";
    position: absolute;
    flex: 1;
    background: #6e74f8;
    width: 57px;
    height: inherit;
    border-radius: 12px 0px 0px 12px;
  }
`;
